import React from  'react'
import { connect } from 'react-redux'


const profile = ({ auth }) => {
    return(
        <div>
        <h1>This is profile page, change your information here.</h1>
        <h1>username: {auth.username}</h1>
        </div>
    )
}

const mapStateToProps = state => ({
    auth: state.auth
})

export default connect(
    mapStateToProps
)(profile)
